// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract ModifierExample {
    address public owner;
    uint256 public value;

    constructor() {
        owner = msg.sender; // Set contract deployer as owner
    }

    // Modifier to restrict function access
    modifier onlyOwner() {
        require(msg.sender == owner, "Not the owner!");
        _;
    }

    // Modifier to check input value
    modifier onlyIfPositive(uint256 _value) {
        require(_value > 0, "Value must be positive");
        _;
    }

    // Function that only owner can call
    function setValue(uint256 _value) public onlyOwner onlyIfPositive(_value) {
        value = _value;
    }
}

